import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css';

function LeaveReviewPage() {
  const history = useHistory();
  const [formData, setFormData] = useState({
    user: '',
    review: '',
    shop: '',
    rating: '',
  });
  const [reviewSubmitted, setReviewSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Отправка данных на сервер (вашему API)
    axios.post('http://localhost:8000/api/feedback/', formData)
      .then((response) => {
        // Обработка успешной отправки, например, сброс формы
        setFormData({
          user: '',
          review: '',
          shop: '',
          rating: '',
        });
        setReviewSubmitted(true);
      })
      .catch((error) => {
        console.error('Ошибка при отправке отзыва', error);
      });
  };

  const navigateToHomePage = () => {
    history.push('/');
  };

  return (
    <div>
      <h1>Leave a Review</h1>
      {reviewSubmitted ? (
        <div>
          <p>Ваш отзыв успешно добавлен.</p>
          <button onClick={navigateToHomePage}>Вернуться на главную страницу</button>
        </div>
      ) : (
        <form className="review-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              placeholder="Имя"
              type="text"
              name="user"
              value={formData.user}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <select
              className="rate-shop-dropdown"
              name="shop"
              value={formData.shop}
              onChange={handleChange}
              required
            >
              <option value="">Выберите магазин</option>
              <option value="Дорорс">Дорорс</option>
              <option value="Розы.бел">Розы.бел</option>
              <option value="rozyminsk.by">rozyminsk.by</option>
              <option value="Розы.бел">Розы.бел</option>
              <option value="daflor.by">daflor.by</option>
              <option value="яцветы.бел">яцветы.бел</option>
            </select>
          </div>
          <div className="form-group">
            <select
              className="rate-shop-dropdown"
              name="rating"
              value={formData.rating}
              onChange={handleChange}
              required
            >
              <option value="">Выберите оценку</option>
              <option value="1">1</option>
              <option value="2">2</option>
              <option value="3">3</option>
              <option value="4">4</option>
              <option value="5">5</option>
            </select>
          </div>
          <div className="form-group">
            <textarea
              className="review-textarea"
              placeholder="Отзыв"
              name="review"
              value={formData.review}
              onChange={handleChange}
              required
            />
          </div>
          <button className="btn-form" type="submit">
            Отправить
          </button>
        </form>
      )}
    </div>
  );
}

export default LeaveReviewPage;
